import React, { useState, useEffect } from 'react';
import './eliminar.css'; // Asegúrate de que tengas el archivo CSS correspondiente.

const Eliminar = () => {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Aquí realiza una solicitud a la API para obtener los datos.
    // Reemplaza 'URL_API' con la URL de tu API real.
    fetch('http://localhost:7777/api/Indicadores')
      .then((response) => response.json())
      .then((fetchedData) => {
        setData(fetchedData);
        setLoading(false);
      })
      .catch((error) => {
        console.error('Error al obtener los datos:', error);
        setLoading(false);
      });
  }, []);

  const handleDelete = (itemId) => {
    setLoading(true);

    // Simula una solicitud a la API para eliminar un elemento por su ID.
    // Reemplaza esto con tu lógica de eliminación real.
    setTimeout(() => {
      const updatedData = data.filter((item) => item.id !== itemId);

      setData(updatedData);
      setLoading(false);
      alert('Elemento eliminado con éxito.');
    }, 1000);
  };


  // Agrega aquí la función que te proporcionaron para eliminar elementos con Axios.

  return (
    <div className="eliminar-container">
      <h2>Eliminar Elementos</h2>
      <table className="eliminar-tabla">
        <thead>
          <tr>
            <th>Indicador</th>
            <th>Descripción</th>
            <th>Categoría</th>
            <th>Fecha de Inicio</th>
            <th>Fecha de Terminación</th>
            <th>Formula</th>
            <th>Frecuencia</th>
            <th>Cumplimiento</th>
            <th>Área</th>
            <th>Acción</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.indicador}</td>
              <td>{item.descripcion}</td>
              <td>{item.categoria}</td>
              <td>{item.fecha_inicio}</td>
              <td>{item.fecha_terminacion}</td>
              <td>{item.formula}</td>
              <td>{item.frecuencia}</td>
              <td>
                {loading ? (
                  'Cargando...'
                ) : (
                  <div className="circle-loader">
                    <svg width="60" height="60">
                      <circle
                        className="circle"
                        cx="30"
                        cy="30"
                        r="27"
                        stroke={getCircleColor(item.cumplimiento)}
                        strokeWidth="7"
                        fill="none"
                        strokeDasharray="170"
                        strokeDashoffset={(170 * (100 - item.cumplimiento)) / 100}
                      />
                      <text x="30" y="30" textAnchor="middle" dy="0.3em" className="percentage">
                        {`${item.cumplimiento}%`}
                      </text>
                    </svg>
                  </div>
                )}
              </td>
              <td>
                <button onClick={() => handleDelete(item.id)}>Eliminar</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Eliminar;
